$(document).ready(function () { 
  

  $.getJSON("/shop.json",  
          function (data) { 
      var statusStart = ''; 


      $.each(data, function (key, value) { 


      //Display Widget Button Data   
        statusStart += "<div id='ID" +  value.id +"' class='widget-shop-item'><img loading='lazy' class='item-logo' src='" + value.logo + "'><br><div class='item-text-container'><h3>" + value.name +"</h3><p>" + value.createdBy + "-" + value.price + "</p></div></div>"; 

         // Append Widget Button
        
    
         setTimeout(function(){
        // widget Button Event Listener
        document.getElementById("ID" + value.id).addEventListener("click", popMenu);
        function popMenu(){
          window.globalName = value.name;
          window.globalImage= value.image; 
          window.globalCreatedBy = value.createdBy; 
          window.globalPrice = value.price; 
          window.globalLogo = value.logo; 
          window.globalLink = value.widgetLink; 
          window.globalSize = value.widgetSize;
          
          document.getElementById('install').style.display='block';
          document.getElementById('nameOutput').innerHTML = value.name;
          document.getElementById('createdByOutput').innerHTML = value.createdBy;
          document.getElementById('priceOutput').innerHTML = value.price;
          document.getElementById('logoOutput').src= value.logo;
          document.getElementById('widgetPreview').src= value.widgetLink;
          if (value.widgetSize == "Large"){
          document.getElementById('widgetPreview').style.height = "350px";
          }
          if (value.widgetSize == "Medium"){
              document.getElementById('widgetPreview').style.height = "145px";
          }
        }
      }, 50);
      }); 
        
      $('#widgetShop').append(statusStart); 
  }); 
}); 



